import React from 'react';
import './styles.css';
import logo from '../../assets/logo.svg'

const Home: React.FC = () =>{
  return (
    <div id="page-home">
      <div className="content">
        <img src={logo} alt="ecoleta" />
      </div>
    </div>
  )
}

export default Home;
